import axios from "axios";
import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

export default function ProfileSellingBets() {
    const params = useParams();
    const [bets, setBets] = useState([]);

    useEffect(() => {
        let product_id = params.action;
        if (product_id) {
            axios.get(`/bets/list-product-bets/${product_id}`)
                .then(res => {
                    setBets(res.data.betsData.bets);
                });
        }
    }, [params]);

    if (bets) {
        return (
            <div className="bg-gray-100 rounded-lg shadow-md overflow-hidden">
                <ul>
                    {bets.length && bets.map(bet => (
                        <li className="flex items-center justify-between px-4 py-3 bg-white border-b border-gray-200">
                            <span className="text-blue-500 mr-2">Покупатель: {bet.user.first_name} {bet.user.last_name}</span>
                            <span className="text-gray-800">Item 1</span>
                            <button className="text-sm text-blue-500 focus:outline-none">Edit</button>
                        </li>
                    ))}
                </ul>
            </div>
        );
    }
}
